import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';

class App extends React.Component {
	constructor() {
		super();
		this.state = {
			sent: true,

		};
	}

	render() {
		return (this.state.sent ? this.a() : this.b());
	}

	submit(e) {
		e.preventDefault();
		const reactData = [{ id: 1, name:' Tom'}, { id: 2, name:' Sarah'}];
		const url = "localhost:3000/register";

		axios.post(url, reactData)
   				.then(res => console.log('Data send'))
   				.catch(err => console.log(err.data))

		this.setState({sent: false});

	}

	a() {
		return (
		<form action="/results" name="services" method="POST">
			<div>
				<input name="service1" type="checkbox" />
				<label>Service #1</label>
				<br />
				<input name="service2" type="checkbox" />
                <label>Service #2</label>
                <br />
				<input name="service3" type="checkbox" />
                <label>Service #3</label>
                <br />
				<input type="submit" onClick={(e)=>this.submit(e)} />
				<br />
			</div>
		</form>);
	}

	b() {
		return <>hello world</>;
	}


}

export default App;
